import React from 'react';
import './Contact.css'

const Contact = () => {
    return (
        <p>Please email me for my resume
        <a href="mailto:rabenson6@msn.com?subject=Please send me your resume!">
        <i class="far fa-envelope"></i>
        </a>
      </p>

    );
}

export default Contact;
